import './App.css';
import mill from './mill.png';
import Switch from '@mui/material/Switch';
const styles = {
  root: {
     height: 500,
     width: 200},
};
function App() {
  return (
    <div className="App">
      <div>
      <img src={mill} alt="Mill" width={100} />
      </div>
      <div>
      <Switch value="checkedA" size="medium" color="warning" inputProps={{ 'aria-label': 'Switch A' }} />
      </div>


    </div>
  );
}

export default App;
